import (
	context "context"
	fern "github.com/go-undiscriminated-union-wire-tests/fern"
	fernclient "github.com/go-undiscriminated-union-wire-tests/fern/client"
	option "github.com/go-undiscriminated-union-wire-tests/fern/option"
)

client := fernclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Service.Rerank(
	context.TODO(),
	&fern.RerankRequest{
		Documents: []*fern.DocumentItem{
			&fern.DocumentItem{
				DocumentObject: &fern.DocumentObject{
					Text: "Carson City is the capital city of the American state of Nevada.",
				},
			},
			&fern.DocumentItem{
				DocumentObject: &fern.DocumentObject{
					Text: "Washington, D.C. is the capital of the United States.",
				},
			},
		},
		Query: "What is the capital of the United States?",
	},
)
